import React, { Component, Fragment } from 'react';
import QouteGenerator from "./components/qouteGenerator/qouteGenerator";
import { connect } from "react-redux";
import { initQoutes } from "./store/actions";
import {randomQouetsUrl} from "./urls";

class App extends Component {
  componentDidMount() {
    this.props.onInitQoutes();

    fetch(randomQouetsUrl)
        .then(response => 
            response.json()
        )
        .then(response => {
          console.log(response);
        })
  }

  render() {
    const qoute = {
      text: `Life is 10% what happens to me and 90% of how I react to it.`,
      source: "Charles Swindoll"
    }

    return (
      <Fragment>
        <QouteGenerator 
          text={qoute.text} 
          source={qoute.source} 
          onClick={() => console.log("abra")}/>
      </Fragment>
    );
  }
}

const mapDispatchToProps = dispatch => ({
  onInitQoutes: () => dispatch(initQoutes)
});

export default connect(null, mapDispatchToProps)(App);
